	add("garage", "{\"term\":\"garage\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old norse\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027garage\u0027 (keeping under cover, protection, shelter) derivative of French \u0027garer\u0027 (to keep under cover, dock, shunt, guard, keep) from Middle french (ca. 1400-1600) \u0027garer\u0027 \u0027garrer\u0027 \u0027guerrer\u0027 partly from Old french (842-ca. 1400) \u0027garir\u0027 \u0027warir\u0027 (from Old Frankish {{m|frk|*warjan}}); and partly from Old french (842-ca. 1400) \u0027varer\u0027 (to fight, defend oneself, protect) from Old norse \u0027varask\u0027 (to defend oneself) reflexive of \u0027vara\u0027 (to ware, watch out, defend) both ultimately from Proto-germanic {{m|gem-pro|*warjaną||to defend, ward off}}, {{m|gem-pro|*warōną||to watch, protect}}, from Proto-indo-european {{m|ine-pro|*wer-||to close, cover, protect, save, defend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building (or section of a building) used to store a car or cars, tools and other miscellaneous items\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A place where cars are servic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"serviced and repai\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"repaired\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe highway to the East Coast which ran through the borough of Ebbfield had always been a main road and even now, despite the vast \u0027\u0027garages\u0027\u0027, the pylons and the gaily painted factory glasshouses which had sprung up beside it, there still remained an occasional trace of past cultures\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A petrol filling station\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An independent automobile repair shop\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A shed for housing an airship or aeroplane; a hangar\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A side way or space in a canal to enable vessels to pass each other; a siding\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A type of guitar rock music, personified by amateur bands playing in the basement or garage; garage rock\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A type of electronic dance music related to house music, with warped and time-stretched sounds; UK garage\", \"priority\":11}]}, \"synonyms\":{}}");

