	add("garbage", "{\"term\":\"garbage\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0026quot;the offal of a fowl, giblets, kitchen waste\u0026quot;, originally \u0026quot;refuse, what is purged away\u0026quot; from Old french (842-ca. 1400) {{m|fro|garber||to refine, make neat or clean}}, of Proto-germanic origin, akin to Old high german (ca. 750-1050) {{m|goh|garawan||to prepare, make ready}}, Old english (ca. 450-1100) {{m|ang|ġearwian||to make ready, adorn}}. More at garb, yare, gear\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bowels of an animal; refuse parts of flesh; offal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Food waste material of any kind\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Garbage\u0027\u0027 is collected on Tuesdays; rubbish on Fridays\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Useless or disposable material; waste material of any kind\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027garbage\u0027\u0027 truck collects all residential municipal waste\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A place or receptacle for waste material\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He threw the newspaper into the \u0027\u0027garbage\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Nonsense; gibberish\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something or someone worthless\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, David R. Portney, \u0027129 More Seminar Speaking Success Tips\u0027, ISBN 9780967851488, [http://books.google.ca/books?id\u003dzBHz64KQMdQC\u0026amp;dq\u003d%22garbage+advice%22\u0026amp;q\u003dgarbage+advic\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003dgarbage%20advice\u0026amp;f\u003dfalse p. 8\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Forget about that \u0027\u0027garbage\u0027\u0027 advice to “act natural”\", \"priority\":12}]}, \"synonyms\":{}}");

	add("garbanzo", "{\"term\":\"garbanzo\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Basque\", \"ancient greek (to 1453)\"], \"text\":\"As calavance, from Spanish \u0027garbanzo\u0027 possibly from Basque \u0027garau\u0027 (seed) + \u0027antzu\u0027 () Another theory suggests an Ancient greek (to 1453) origin \u0027erebinthos\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An edible pulse, of the family Leguminosae or Fabaceae and subfamilies Faboideae or Papilionoideae, of which the plant has white or purple-blue flowers and small feathery leaves on both sides of the stem and yields pods containing two to three peas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A seed of this plant; the chickpea\", \"priority\":2}]}, \"synonyms\":{}}");

