	add("garden", "{\"term\":\"garden\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"{{PIE root|en|gʰerdʰ}}From Middle english (1100-1500) {{m|enm|garden}}, from Anglo-norman {{m|fro|gardin}} (compare modern French {{m|fr|jardin}} from Old french (842-ca. 1400) {{m|fro|jardin}}), diminutive (compare hortus \u0027gardinus\u0027) or oblique form of *\u0027gard\u0027 (compare Old french (842-ca. 1400) {{m|fro|jart}}), from Old Low Frankish {{m|frk|*gardin}}, {{m|frk|*gardo||fenced in yard, garden}} (compare Dutch {{m|nl|gaarde}}, {{m|nl|gaard}}), from Proto-germanic {{m|gem-pro|*gardô}} (compare West Frisian {{m|fy|gard}}, Low German {{m|nds|Goorn}}, German {{m|de|Garten}}), from Proto-germanic {{m|gem-pro|*gardaz||yeard}}. More at {{l|en|yard}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outdoor area containing one or more types of plants, usually plants grown for food or ornamental purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Such an ornamental place to which the public have access\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Taking place in, or used in, such a garden\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027garden\u0027\u0027 parties of pre-1914 were something to be remembered. Everyone was dressed up to the nines, high-heeled shoes, muslin frocks with blue sashes, large leghorn hats with drooping roses. There were lovely iceswith every kind of cream cake, of sandwich, of éclair, and peaches, muscat grapes, and nectarines\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ground\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"grounds at the front or back of a house\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"amp;emsp\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A cluster, a bunch\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"pubic Pubic hair or the genitalia it masks\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Lee Tyler, \u0027Biblical Sexual Morality and What About Pornography?\u0027 viewed at [http://www.etext.org/Religious.Texts/Polyamory/BiblcaLSexPornMorality etext.org] on 9 May 200\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Blow on my \u0027\u0027garden\u0027\u0027 [speaking of her genitalia], so the spices of it may flow out. Let my Beloved come into His \u0027\u0027garden\u0027\u0027 [her pubic area] and eat His pleasant fruits. \u0027(A commentary on Song of Solomon 4:16, which was written in Hebrew c950 BC; book footnotes shown here bracketed within the text; many scholars disagree with the Biblical interpretation, which is included as evidence of usage in 1995 rather than intended meaning in 950 BC\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"c2004\u0027\u0027, Hair Care Down There, Inc, \u0027The History of Hair Removal\u0027 viewed at [http://www.haircaredownthere.com/articles.asp haircaredownthere.com] on 9 May 2006\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Primping and pruning the secret \u0027\u0027garden\u0027\u0027 might seem like a totally 21st century concept, but the fact is women have gotten into below-the-belt grooming since before the Bronze Age\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Guest on Female First Forum at [http://www.femalefirst.co.uk/board/viewtopic.php?t\u003d4636\u0026amp;start\u003d15\u0026amp;sid\u003d1eeba9e1263e75b259d0d72ed4ed9f0c femalefirst.co.uk] posting on \u0027Fashionable to shave the pubic area??\u0027 viewed on 9 May 200\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s [unshaven] dark pubic triangle, glistening with pussy nectar and promising access to a hidden \u0027\u0027garden\u0027\u0027 of delights\", \"priority\":15}]}, \"synonyms\":{}}");

	add("gardener", "{\"term\":\"gardener\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027gardinier\u0027 See garden\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who gardens; one who grows plants or cultivates a garden\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAt the far end of the houses the head \u0027\u0027gardener\u0027\u0027 stood waiting for his mistress, and he gave her strips of bass to tie up her nosegay. This she did slowly and laboriously, with knuckly old fingers that shook\", \"priority\":2}]}, \"synonyms\":{}}");

	add("garderobe", "{\"term\":\"garderobe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027garderobe\u0027 from \u0027garder|lang\u003dfr\u0027 () + \u0027robe|lang\u003dfr\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A store room or wardrobe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lavatory, especially in a castle and built into the outer wall, with vent directly over the moat or midden\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027A Clash of Kings\u0027, Bantam 2011, p. 444\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He splashed some tepid water on his face from the basin beside his bed and took his time squatting in the \u0027\u0027garderobe\u0027\u0027, the night air cold on his bare skin\", \"priority\":4}]}, \"synonyms\":{}}");

	add("gargalesis", "{\"term\":\"gargalesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heavy tickling often leading to laughter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027 G. Stanley Hall \u0026amp; Arthur Alliń, \u0026quot;The Psychology of Tickling, Laughing, and the Comic,\u0026quot; \u0027The American Journal of Psychology\u0027, 9(1) (Oct., 1897), pp. 1-4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pending a better nomenclature we suggest for the former the term knismesis and for the latter the term \u0027\u0027gargalesis,\u0027\u0027 with the adjectives knismic and gargalic, hyperknismesis and hyper-gargalesis for excess, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 Christine R. Harris, \u0026quot;The Mystery of Ticklish Laughter,\u0026quot; \u0027American Scientist,\u0027 87(4) (July-August 1999), p34\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Gargalesis\u0027\u0027, the heavy tickle associated with play and laughter and seemingly with pleasure, may be limited to the primates, but not solely to human beings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 August 18-21, Alena Neviarouskaya, Dzmitry Tsetserukou, Helmut Prendinger, Naoki Kawakami, Susumu Tachi \u0026amp; Mitsuru Ishizuka, \u0026quot;Emerging System for Affectively Charged Interpersonal Communication,\u0026quot; ICROS-SICE International Joint Conference 2009, p338\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The second type of tickle called \u0027\u0027gargalesis\u0027\u0027 is evoked by a heavier touch to particular areas of the body such as armpits or ribs. Such kind of stimuli usually results in laugher and squirming\", \"priority\":7}]}, \"synonyms\":{}}");

	add("gargoyle", "{\"term\":\"gargoyle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027gargouille\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A carved grotesque figure on a spout which conveys water away from the gutters\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, w:Rafael Rafael Sabatini, \u0027The Trampling of the Lilies‎\u0027, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"From between set teeth came now a flow of oaths and imprecations as steady as the flow of water from the \u0027\u0027gargoyle\u0027\u0027 overhead\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any decorative carved grotesque figure on a building\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fictional winged monster\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Mel Odom, \u0027The Secret Explodes‎\u0027, page 20\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Almost immediately one of the \u0027\u0027gargoyles\u0027\u0027 swept down from the sky and attacked him. The \u0027\u0027gargoyle\u0027\u0027s momentum drove them both over the side\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ugly woman\", \"priority\":8}]}, \"synonyms\":{}}");

	add("garibaldi", "{\"term\":\"garibaldi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a biscuit consisting of currants squashed between layers of flaky pastry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bright yellow/orange damselfish, of the genus , from the seas of southern California\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A jacket worn by women; so called from its resemblance in shape to the red shirt worn by the Italian patriot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("garlic", "{\"term\":\"garlic\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From the Old english (ca. 450-1100) {{m|ang|gārlēac}}, from {{m|ang|gār}} (“spear”, in reference to the cloves) + {{m|ang|sc\u003dLatinx|lēac||leek}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant, \u0027Allium sativum\u0027, related to the onion, having a pungent bulb much used in cooking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("garment", "{\"term\":\"garment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 \u0027guarnement\u0027 from \u0027lang\u003dfro|garnir\u0027 () from Frankish\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single item of clothing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This new-comer was a man who in any company would have seemed striking.Indeed, all his features were in large mold, like the man himself, as though he had come from a day when skin \u0027\u0027garments\u0027\u0027 made the proper garb of men\", \"priority\":2}]}, \"synonyms\":{}}");

	add("garner", "{\"term\":\"garner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027gerner\u0027 () from Old french (842-ca. 1400) \u0027gernier\u0027 () variant of \u0027grenier\u0027 () from Latin {{m|la|grānārium||granary}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A granary; a store of grain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That\u0027 our \u0027\u0027garners\u0027\u0027 \u0027may be\u0027 full, affording all manner of store: \u0027that\u0027 our sheep may bring forth thousands and ten thousands in our streets\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Whose fan \u0027is\u0027 in his hand, and he will throughly purge his floor, and gather his wheat into the \u0027\u0027garner\u0027\u0027; but he will burn up the chaff with unquenchable fire\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An accumulation, supply, store, or hoard of something\", \"priority\":4}]}, \"synonyms\":{}}");

	add("garret", "{\"term\":\"garret\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Middle English, from Old french (842-ca. 1400) \u0027garite\u0027 (\u0026quot;watchtower\u0026quot;). Compare guerite, of same origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attic or semi-finished room just beneath the roof of a house\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1660\u0027\u0027, Samuel Pepys Diary\u0027, January 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This morning (we living lately in the \u0027\u0027garret\u0027\u0027,) I rose, put on my suit with great skirts, having not lately worn any other clothes but them\", \"priority\":3}]}, \"synonyms\":{}}");

	add("garrison", "{\"term\":\"garrison\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"Old french (842-ca. 1400) \u0027garison\u0027 \u0027guarison\u0027 from Frankish ultimately of Proto-germanic origin; compare \u0027guard\u0027 \u0027ward\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A permanent military post\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The troops stationed at such a post\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Occupants\", \"priority\":3}]}, \"synonyms\":{}}");

	add("garron", "{\"term\":\"garron\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"{{borrowing|gd|gearran|lang\u003den}}, Irish \u0027gearrán\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small and usually disdained type of horse, typically bred in Scotland and Ireland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027A Storm of Swords\u0027, Bantam 2011, page 445\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To the west Ollo Lophand and Tim Stone were moving through the horselines, feeding and watering the remaining \u0027\u0027garrons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027Glencoe\u0027, Amberley 2009, page 37\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"For transport they might keep short, sturdy \u0027\u0027garrons\u0027\u0027: and the chief went nowhere on foot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("garrote", "{\"term\":\"garrote\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027garrote\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an iron collar formerly used in Spain to execute people by strangulatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004:\u0027\u0027 w: Chris Wallace Chris Wallace, \u0027Character: Profiles in Presidential Courage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Spanish had responded to the insurgency with characteristic brutality. They gave rebels the \u0026quot;usual four shots in the back\u0026quot; or the \u0027\u0027garrote\u0027\u0027 - an iron collar tightened around the victim\u0027s neck with a screw until he was strangled to death\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"something, especially a cord or wire, used for strangulatio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The mob boss was known for having his enemies executed with a \u0027\u0027garrote\u0027\u0027 of piano wire\", \"priority\":5}]}, \"synonyms\":{}}");

	add("garrotter", "{\"term\":\"garrotter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|garrotte|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"someone who garrottes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("garrulity", "{\"term\":\"garrulity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being garrulous\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, w:Henry Henry James, \u0027Daisy Miller\u0027, pt. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She delivered herself of a great number of original reflections. It was the most charming \u0027\u0027garrulity\u0027\u0027 he had ever heard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, w:Margaret Margaret Pedler, \u0027The Lamp of Fate\u0027, ch. 31\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A stream of inquiry and comment issued from her lips. . . . At last Gillian managed to stem the torrent of \u0027\u0027garrulity\u0027\u0027 and interposed a question\", \"priority\":5}]}, \"synonyms\":{}}");

